import { Box , InputBase, Button, styled } from '@mui/material';

const Container = styled(Box)({
    background: '#445A6F',
    padding: 10 
});


const Form = () => {

    return (
        <Container>
            <InputBase 
                placeholder="City"
            />

            <InputBase 
                placeholder="Country"
            />
            <Button
                variant="contained"
                >Get Weather</Button>
        </Container>
    )
} 

export default Form;
